import { Link } from 'react-router-dom';
import dropDwon from '../../assets/caret-down.svg';
import Logo from '../../assets/logo.png';
import SearchIcon from '../../assets/search-icon.svg';
import DropDown from '../drop-down/drop-down.component.jsx';
import './navigation.styles.scss';
import { useState } from 'react';
import { faL } from '@fortawesome/free-solid-svg-icons';
const Navigation  =() =>{
const [click, setClick] = useState(false)

const handelClick = () => setClick(!click)
const getstart =() => setClick(false);
const [DropDwon,setDropDown] = useState(false);

  return(
    <div>
    <nav>
        <Link to='/' className='navbar-logo'>
          <img src={Logo} width={120} height={90.24}/>
        </Link>
    <div>
      <ul id='navbar' >
      <li>  
        <Link to='/get-started' className='getstart' onClick={getstart}> Get Started</Link>
      </li>
      <li>
        <Link to='/shop' className='shop' onClick={dropDwon} >Shop <img src={dropDwon}width={40} height={20.89}/></Link>
        <i className={click ? 'fas fa-times' : 'fas fa-bars'}/>
        {/* <select>
        <img src={dropDwon}width={40} height={20.89}/>
        <i className={click ? 'dropDwon' : 'dropDwon'/}>
        </select> */}
      </li>
      <li>
        <Link to='/useful-information' className='usefulinformation' onClick={dropDwon}>UseFul Information 
          <img src={dropDwon}width={40} height={20.89}/>
        </Link>
        {DropDwon && <DropDown/>}
      </li>
      <li>
        <Link to='/about.component.jsx' className='about' onClick={dropDwon}>About
        <img src={dropDwon}width={40} height={20.89}/>
        </Link>
        {DropDwon && <DropDown/>}
      </li>
      <img src={SearchIcon} width={22.4} height={22.4}/>
    </ul>
    </div>
    </nav>
    {/* <div>
      <ShopOurProducts/>
    </div> */}
    {/* <div><ShopOurProductHome/></div> */}
    </div>


  )
}

export default Navigation;
